import React from 'react';

const OrderUserInfo = ({ users }) => {
    const showOrderInTable = (user) => (
        <table className='table table-bordered' >
            <thead className='thead-light'>
                <tr>
                    <th scope='col' >Name</th>
                    <th scope='col' >Address</th>
                </tr>
            </thead>

            <tbody>
                {user.users.map((u, i) => (
                    <tr key={u} >
                        <td><b>{u.name}</b></td>
                        <td>{u.address}</td>
                    </tr>
                ))}
            </tbody>

        </table>
    );
    return (
        <>
            {users.map((user) => (
                <div key={user._id} className="row pb-5">
                    {showOrderInTable(user)}
                </div>
            ))}
        </>
    )
}
export default OrderUserInfo;
